import Theme from '../styles/theme';
import { useState } from 'react';

function Contact() {

    const [inputs, setInputs] = useState({
        fullname: '',
        email: '',
        request: ''
    })

    const handleType = (e) => {
        e.persist()
        setInputs({...inputs, [e.target.name]: e.target.value})
    }

    const handleContact = async(e) => {
        e.preventDefault()
    }

    return (
        <div className='body'>
            <form onSubmit={handleContact}>
                <label>First Name</label>
                <input 
                    onChange={handleType}
                    name='firstname'
                    value={inputs.firstname}
                    required
                />
                <label>Email</label>
                <input 
                    onChange={handleType}
                    name='email'
                    value={inputs.email}
                    required
                />
                <label>What can we help you with</label>
                <textarea 
                    onChange={handleType}
                    name='request'
                    value={inputs.request}
                    required
                />
            </form>
            <style jsx>{`
                .body {
                    float: left;
                    width: 100%;
                    margin-top: 80px;
                }
            `}</style>
        </div>
    )
}

export default Contact
